import React from 'react';
import Menu from '../../components/Menu';
import TabelaPedidos from '../../components/TabelaPedidos';
import Titulo from '../../components/Titulo';
import './index.css';
import { Container } from 'react-bootstrap';

function Home() {
    return (
        <div>
            <Menu />
            <Breadcrumb>
                <Breadcrumb.Item active="/">Principal</Breadcrumb.Item>
            </Breadcrumb>
            <Container>
                <Titulo name='Pedidos' />
                <TabelaPedidos />
            </Container>

        </div>

    );
}

export default Home;
